import React from 'react';
import PropTypes from 'prop-types';
import styles from './List.module.css';

class List extends React.Component{
    render(){
        return(
            <table className="table">
                <thead className="thead-dark">
                <tr>
                    <th scope="col">Název</th>
                    <th scope="col">Ingredience</th>
                    <th scope="col">Popis</th>
                </tr>
                </thead>
                <tbody>
                {
                    this.props.foods.map(f => {
                        <tr>
                            <td>f.name</td>
                            <td>
                                <div className="ingredience-list">
                                    <label className={styles.ingredience + " btn-sm btn-info"}>Mléko</label>
                                    <label className={styles.ingredience + " btn-sm btn-info"}>Máslo</label>
                                    <label className={styles.ingredience + " btn-sm btn-info"}>Mouka</label>
                                </div>
                            </td>
                            <td>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Fusce nibh. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae. Fusce tellus odio, dapibus id fermentum quis, suscipit id erat.</td>
                        </tr>
                    })
                }

                </tbody>
            </table>
        );
    }
}
export default List;
